port: 7890
socks-port: 7891
mixed-port: 7890
redir-port: 9797
tproxy-port: 9898
mode: rule
allow-lan: true
unified-delay: true
bind-address: '*'
log-level: silent
ipv6: true
geodata-mode: false
geodata-loader: memconservative
external-controller: 0.0.0.0:9090 
# secret: "123456"
external-ui: /dashboard
# tcp-concurrent: false
find-process-mode: strict

profile:
  store-selected: true
  store-fake-ip: false


tun:
  enable: true
  device: utun
  mtu: 9000
  stack: system # gvisor / lwip / system
  dns-hijack:
    - any:53
    - tcp://any:53
  auto-route: true
  auto-detect-interface: true
  # include_android_user:
    # - 0
    # - 10
  # include_package:
  # - com.android.chrome
  # exclude_package:
    # - com.whatsapp

dns:
  enable: true
  ipv6: true
  # prefer-h3: false
  default-nameserver:
    - 114.114.114.114
    - 8.8.8.8
    - 1.1.1.1
    - tls://223.5.5.5:853
    - https://223.5.5.5/dns-query
  listen: 0.0.0.0:1053
  use-hosts: true
  enhanced-mode: fake-ip
  fake-ip-range: 198.18.0.1/16
  fake-ip-filter:
    - '*.lan'
  nameserver:
    - 8.8.8.8
    - 1.0.0.1
  proxy-server-nameserver:
    - tls://223.5.5.5
    - tls://dot.pub
    - https://120.53.53.53/dns-query
    - https://223.5.5.5/dns-query
    - tls://8.8.4.4
    - tls://1.1.1.1
    - quic://a.passcloud.xyz:784
    - https://8.8.8.8/dns-query  
  fallback:
    - tls://8.8.4.4
    - tls://1.1.1.1
  # fallback-filter:
    # geoip: true
    # geoip-code: ID
    # ipcidr:
      # - 240.0.0.0/4
    # domain:
      # - '+.google.com'
      # - '+.facebook.com'
      # - '+.youtube.com'





